  \ = \"PUBLIC_CAMEL_CASE\"\n    user.code_private_variable_formatter = \"PRIVATE_CAMEL_CASE\"\
  \n    user.code_protected_variable_formatter = \"PUBLIC_CAMEL_CASE\"\n    user.code_public_variable_formatter\
  \ = \"PUBLIC_CAMEL_CASE\"\n"
